#import <Foundation/Foundation.h>
#import <QuartzCore/QuartzCore.h>

int main(){

  int maxMismatches = 1, mismatches = 0;
  ///*
  NSString *sourceString = @"";

  NSString *patternToSearch = @"CATGGTT";
  //*/

  //NSString *sourceString = @"AAATCGACCTTAGAACGGCCA";
  //NSString *patternToSearch = @"CGACC";

  NSMutableString *currMatch = [NSMutableString string];

  [[NSFileManager defaultManager] createFileAtPath:@"patterns.txt" contents:nil attributes:nil];

  CFTimeInterval start = CACurrentMediaTime();

  for(int i = 0; i < (sourceString.length - patternToSearch.length); i++){
    [currMatch setString:@""];
    mismatches = 0;
    for(int j = i, k = 0; j < (i + patternToSearch.length); j++, k++){
      [currMatch appendString: [NSString stringWithFormat:@"%c", [sourceString characterAtIndex:j]]];
      if(!([[NSString stringWithFormat:@"%c", [sourceString characterAtIndex:j]] isEqual:[NSString stringWithFormat:@"%c", [patternToSearch characterAtIndex:k]]])){
        mismatches++;
      }
    }
    if(mismatches <= maxMismatches){
      [currMatch writeToFile:@"patterns.txt" atomically:YES encoding:NSUTF8StringEncoding error:nil];
    }
  }

  CFTimeInterval e_time = (CACurrentMediaTime() - start);

  printf("%lf\n", e_time);

  return 0;
}
